import CustomHttpService from './custom-http.service';
import Config from '../config/config';
import CookieManagerService from './cookie.service';
import { AppConstant } from '../constants/app.constant';
import EncodeDecodeType from '../actiontype/encode-decode-type';
class BlankCallService {

    static fetchBlankCallApi() {
        const config = {
            headers: {
            }
        };
        const msisdn = CookieManagerService.getItem(AppConstant.MSISDN);
        const transactionId = CookieManagerService.getItem(AppConstant.CORRELATION_ID) || "null";
        const authDetails = CookieManagerService.getAuthDetails();
        const blankCallObj = {
            'transactionId': transactionId,
            'lob': authDetails && authDetails['lob'] ? authDetails['lob'] : null,
            'customerMsisdn': msisdn ? msisdn : null,
            'agentId': authDetails && authDetails['agentId'] ? authDetails['agentId'] : null,
            'tagging': '',
            'notes': '',
            'source': authDetails && authDetails['source'] ? authDetails['source'] : null,
            'dff': ''
        };
        var url = Config.contextPath + "user/rest/v1.0/tag/postpaid/siebel/blankCall";
        return CustomHttpService.post(url, blankCallObj, config, EncodeDecodeType.DEFAULT);
    }
}

export default BlankCallService;
